INSERT INTO `artikel` VALUES (1, 'Faktor Risiko OCD\r\n', 'Faktor risiko OCD meliputi faktor keturunan, struktur otak dan fungsinya (masih belum jelas), serta lingkungan hidup. Namun, hal yang paling memengaruhi adalah lingkungan hidup yang tidak mendukung perkembangan psikis pengidap sewaktu kecil, yaitu ketika ', 'https://image-cdn.medkomtek.com/sl-BjXmEziuG1UB0dCnWzbGGbco=/640x640/smart/klikdokter-media-buckets/medias/2327192/original/008572400_1636352942-Gangguan-Mental-OCD.jpg', '2021-12-09 20:10:11', 'Dwi', 'Faktor risiko OCD', NULL, NULL);
INSERT INTO `artikel` VALUES (2, 'Pengertian OCD', 'Obsessive-Compulsive Disorder (OCD) adalah sejenis gangguan mental. Orang dengan OCD memiliki pikiran dan dorongan yang tidak dapat dikendalikan dan berulang (obsesi), serta perilaku (paksaan) kompulsif. Contoh perilaku kompulsif adalah mencuci tangan 7 k', 'https://image-cdn.medkomtek.com/sl-BjXmEziuG1UB0dCnWzbGGbco=/640x640/smart/klikdokter-media-buckets/medias/2327192/original/008572400_1636352942-Gangguan-Mental-OCD.jpg', '2021-12-09 20:09:57', 'Farrel', 'Obsessive-Compulsive Disorder (OCD) adalah sejenis gangguan mental.', NULL, NULL);
INSERT INTO `artikel` VALUES (3, 'Penyebab', 'OCD adalah gangguan umum yang menyerang orang dewasa, remaja, dan anak-anak di seluruh dunia. Kebanyakan orang didiagnosis pada usia 19 tahun, biasanya dalam usia dini pada anak laki-laki daripada anak perempuan.\r\n\r\n', 'https://image-cdn.medkomtek.com/sl-BjXmEziuG1UB0dCnWzbGGbco=/640x640/smart/klikdokter-media-buckets/medias/2327192/original/008572400_1636352942-Gangguan-Mental-OCD.jpg', '2021-12-09 20:11:36', 'Ageng', 'OCD adalah gangguan umum yang menyerang orang dewasa, remaja, dan anak-anak di seluruh dunia.', NULL, NULL);
INSERT INTO `artikel` VALUES (5, 'TESA 2', 'Ini artikel tentang tesa 2', 'https://image-cdn.medkomtek.com/sl-BjXmEziuG1UB0dCnWzbGGbco=/640x640/smart/klikdokter-media-buckets/medias/2327192/original/008572400_1636352942-Gangguan-Mental-OCD.jpg', '2021-12-09 20:45:32', 'TESA 3', 'Ini artikel tentang tesa 2', NULL, NULL);

