INSERT INTO `blog_artikels` VALUES (1, 'Kesehatan Mental', '<div _ngcontent-halodoc-c125=\"\" class=\"article-image-container w-100\" style=\"width: 680.25px; padding: 0px 16px 20px; color: rgb(3, 1, 0); font-family: Nunito, sans-serif;\"><ol><li style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">Pengertian&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">Kesehatan Mental</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">.&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">Kesehatan mental</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">&nbsp;yang baik adalah kondisi ketika batin kita berada dalam keadaan tentram dan tenang, sehingga memungkinkan kita untuk menikmati kehidupan sehari-hari dan menghargai orang lain di sekitar.</span></li></ol><h2 style=\"font-size: 18px; font-family: &quot;Modern Era Bold&quot;, sans-serif; color: rgb(54, 46, 73); letter-spacing: 0.5px;\"><span style=\"font-weight: bolder; color: rgb(0, 0, 0);\">Jenis-jenis Penyakit Psikologi</span></h2><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><p style=\"color: rgb(54, 46, 73); font-family: &quot;Modern Era&quot;, sans-serif; letter-spacing: 0.5px;\">Terdapat beberapa jenis&nbsp;<a href=\"https://www.orami.co.id/magazine/mengenal-gangguan-psikosomatik-gangguan-jiwa-yang-berpengaruh-ke-fisik/\" style=\"color: rgb(255, 85, 85);\">gangguan mental</a>&nbsp;atau penyakit psikologi yang sering ditemui dalam kehidupan sehari-hari. Apa saja? Yuk simak!</p><p style=\"color: rgb(54, 46, 73); font-family: &quot;Modern Era&quot;, sans-serif; letter-spacing: 0.5px;\"><br></p></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">1. Gangguan Kecemasan</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"Gejala kecemasan.jpeg\" class=\"richtext-image full-width note-float-left\" height=\"461\" src=\"https://cdnt.orami.co.id/unsafe/468x281/cdn-cas.orami.co.id/parenting/images/C0E693A1-D869-479A-A415-29BA49E576D7.width-800.jpg\" width=\"768\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Nama bekennya<span>&nbsp;</span><i style=\"box-sizing: border-box;\">anxiety disorder</i>. “Biasanya, penderita akan merespons benda atau situasi tertentu dengan sangat ketakutan, disertai gejala panik seperti detak<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/buah-yang-bagus-untuk-jantung/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">jantung</a><span>&nbsp;</span>yang cepat dan berkeringat,” kata Dr. Timothy Scarella, instruktur psikiatri di<span>&nbsp;</span><a href=\"https://www.health.harvard.edu/mind-and-mood/always-worried-about-your-health-you-may-be-dealing-with-health-anxiety-disorder\" rel=\"nofollow\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">Harvard Medical School</a>.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Moms mungkin pernah mengalami panik saat ujian atau wawancara kerja. Namun, gangguan kecemasan berbeda dengan pengalaman Moms saat melakukan ujian tersebut.</p><div class=\"inner-row my-8\" data-reactroot=\"\" style=\"box-sizing: border-box; margin: 0px -16px;\"></div><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Anxiety disorder</i><span>&nbsp;</span>merupakan gangguan mental, yang membuat penderitanya hidup dengan penuh kecemasan, ketakutan, serta kekhawatiran berlebih.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</b><span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/bahaya-mendiagnosis-kesehatan-mental-sendiri/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(255, 85, 85);\">Jangan Andalkan Internet, Ini Bahaya Mendiagnosis Kesehatan Mental Sendiri</b></a></p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">2. Gangguan Suasana Hati</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"cara mengobati kesedihan mendalam setelah suami meninggal dunia 01\" class=\"richtext-image full-width note-float-left\" height=\"416\" src=\"https://cdnt.orami.co.id/unsafe/468x244/cdn-cas.orami.co.id/parenting/images/cara_mengobati_kesedihan_mendalam_setelah_suam.width-800.jpg\" width=\"800\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Disebut juga gangguan afektif, melibatkan perasaan sedih atau perasaan merasa terlalu bahagia, atau fluktuasi dari kebahagiaan dan kesedihan ekstrem.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Beberapa contoh penyakit psikologi yang termasuk gangguan suasana hati adalah<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/tanda-anak-gangguan-bipolar/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">bipolar</a>, depresi jangka panjang, gangguan afektif musiman, perubahan suasana hati dan iritabilitas yang terjadi selama fase pramenstruasi, serta<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/ini-gejala-fisik-depresi-yang-terlihat/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">depresi</a><span>&nbsp;</span>karena penyakit fisik.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</b><span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/cara-alami-sembuhkan-bipolar/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(255, 85, 85);\">Ternyata Penyakit Bipolar Dapat Disembuhkan Secara Alami, Berikut 3 Caranya</b></a></p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">3. Gangguan Psikotik</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"artikel hero skizofrenia\" class=\"richtext-image full-width note-float-left\" height=\"449\" src=\"https://cdnt.orami.co.id/unsafe/468x263/cdn-cas.orami.co.id/parenting/images/artikel_hero-skizofrenia.width-800.jpg\" width=\"800\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Gangguan psikotik melibatkan kesadaran dan pemikiran yang menyimpang.</p><div class=\"inner-row my-8\" data-reactroot=\"\" style=\"box-sizing: border-box; margin: 0px -16px;\"></div><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">\"Gejala paling umum dari kelainan psikotik adalah halusinasi, seperti mendengar suara dan khayalan yang tidak bisa dilihat orang lain,” kata Dr Scarella.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Mengutip<span>&nbsp;</span><a href=\"https://www.webmd.com/schizophrenia/guide/mental-health-psychotic-disorders\" rel=\"nofollow\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">WebMD</a>, beberapa penyakit psikologi yang termasuk dalam gangguan psikotik ini, di antaranya:</p><ul style=\"box-sizing: border-box; margin-bottom: 1rem; margin-top: 0px;\"><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Skizofrenia</b>, orang dengan penyakit ini mengalami perubahan perilaku dan gejala lain, seperti delusi dan halusinasi yang berlangsung lebih dari 6 bulan. Penyakit psikologi ini biasanya memengaruhi kehidupan penderitanya di tempat kerja atau sekolah, serta hubungan mereka dengan orang lain.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Paraphrenia</b>, penyakit psikologu ini memiliki gejala yang mirip dengan<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/paranoid/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">skizofrenia</a><span>&nbsp;</span>dan biasanya dimulai pada usia lanjut, ketika orang sudah tua.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan skizofreniformis</b>, gangguan mental ini termasuk gejala skizofrenia, tetapi gejalanya berlangsung lebih singkat, antara 1 dan 6 bulan.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan skizoafektif</b>, merupakan orang yang memiliki gejala skizofrenia dan gangguan<span>&nbsp;</span><i style=\"box-sizing: border-box;\">mood</i>, seperti depresi atau gangguan bipolar.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan psikotik singkat</b>, orang dengan penyakit ini biasanya mengalami perilaku psikotik yang singkat secara tiba-tiba, seringkali sebagai respons terhadap peristiwa yang sangat menegangkan, seperti kematian dalam keluarga. Pemulihannya cenderung cepat, biasanya kurang dari sebulan.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan psikotik bersama</b><span>&nbsp;</span>(juga disebut<i style=\"box-sizing: border-box;\"><span>&nbsp;</span>folie à deux</i>), biasanya terjadi ketika satu orang dalam suatu hubungan memiliki delusi dan orang lain dalam hubungan tersebut juga mengalami delusi tersebut.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan delusi</b>, penderitanya mengalami delusi (kepercayaan yang salah dan tetap) yang melibatkan situasi kehidupan nyata yang mungkin benar tetapi sebenarnya tidak, seperti diikuti, diplot, atau menderita penyakit. Khayalan berlangsung setidaknya selama 1 bulan.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan psikotik yang diinduksi zat</b>, kondisi ini disebabkan oleh penggunaan atau penarikan dari obat-obatan, seperti halusinogen dan kokain, yang menyebabkan<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/halusinasi/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">halusinasi</a>, delusi, atau kebingungan bicara.</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Gangguan psikotik akibat kondisi medis lain</b>, halusinasi, delusi, atau gejala gangguan psikotik lain dapat terjadi karena penyakit lain yang memengaruhi fungsi otak, seperti cedera kepala atau<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/diagnosis-dan-penanganan-tumor-otak-pada-anak/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">tumor otak</a>.</li></ul><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</b><span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/4-manfaat-anak-punya-teman-khayalan/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(255, 85, 85);\">4 Manfaat Anak Punya Teman Khayalan, Jangan Langsung Khawatir!</b></a></p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">4. Gangguan Makan</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"woman-with-anorexia (1).jpg\" class=\"richtext-image full-width note-float-left\" height=\"466\" src=\"https://cdnt.orami.co.id/unsafe/468x312/cdn-cas.orami.co.id/parenting/images/woman-with-anorexia_1.width-800.jpg\" width=\"700\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Biasanya diakibatkan emosi ekstrem, sikap, dan perilaku yang melibatkan berat badan dan makanan.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Penyakit psikologi yang termasuk gangguan makan paling umum, yaitu:</p><ul style=\"box-sizing: border-box; margin-bottom: 1rem; margin-top: 0px;\"><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Anoreksia</b>: penolakan untuk mempertahankan<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/5-inspirasi-seleb-yang-berhasil-menurunkan-berat-badan-part-1/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">berat badan</a><span>&nbsp;</span>yang sehat dan rasa takut yang berlebihan terhadap peningkatan berat badan akibat pencitraan diri yang menyimpang</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Bulimia</b>: makan secara berlebihan kemudian mencoba mengeluarkan kembali apa yang telah mereka makan, seperti dimuntahkan</li><li style=\"box-sizing: border-box;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\"><i style=\"box-sizing: border-box;\">Binge eating disorder</i></b>: makan dalam jumlah banyak dan sulit dihentikan.</li></ul><div class=\"inner-row my-8\" data-reactroot=\"\" style=\"box-sizing: border-box; margin: 0px -16px;\"></div><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</b><span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/hubungan-antara-depresi-dan-gangguan-makan-ketahui-gejalanya/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(255, 85, 85);\">Hubungan Antara Depresi dan Gangguan Makan, Ketahui Gejalanya</b></a></p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\"><br></b></h3><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\"><br></b></h3><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">5. Gangguan Kontrol Impuls dan Kecanduan</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"Penyebab perut buncit - merokok.jpg\" class=\"richtext-image full-width note-float-left\" height=\"450\" src=\"https://cdnt.orami.co.id/unsafe/468x264/cdn-cas.orami.co.id/parenting/images/Penyebab_perut_buncit_-_merokok.width-800.jpg\" width=\"800\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Penyakit psikologis lainnya adalah gangguan kontrol impuls dan kecanduan.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Penderita gangguan kontrol impuls tidak dapat menahan dorongan untuk melakukan tindakan yang dapat membahayakan dirinya sendiri atau orang lain.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Contoh gangguan ini adalah pyromania (gangguan mental yang ditandai muncul dorongan kuat untuk sengaja menyulut api untuk meredakan ketegangan dan biasanya menimbulkan perasaan lega atau puas setelah melakukannya) dan kleptomania (mencuri).</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Orang dengan gangguan kontrol impuls dan kecanduan memiliki keterlibatan sangat dalam dengan objek kecanduan mereka sehingga mereka mulai mengabaikan tanggung jawab dan hubungan dengan orang lain.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</b><span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/perilaku-impulsif/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(255, 85, 85);\">Yuk! Kenali Gejala hingga Faktor Penyebab Perilaku Impulsif</b></a></p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">6. Gangguan Obsesif-Kompulsif</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"Jangan Remehkan, Ini 7 Cara Mengatasi OCD\" class=\"richtext-image full-width note-float-left\" height=\"449\" src=\"https://cdnt.orami.co.id/unsafe/468x263/cdn-cas.orami.co.id/parenting/images/Ocd-Hero.width-800.jpg\" width=\"800\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Ragam penyakit psikologi selanjutnya adalah OCD atau<span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/tanda-penyakit-ocd/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><i style=\"box-sizing: border-box; color: rgb(255, 85, 85);\">obsessive-compulsive disorder</i></a><span>&nbsp;</span>yaitu sering mengalami pikiran obsesif dan perilaku kompulsif.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Ada pikiran, gambar, atau dorongan yang tidak diinginkan dan tidak menyenangkan memasuki pikiran dan menyebabkan rasa cemas, jijik atau tidak senang.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">“Contohnya, bila seseorang takut rumahnya dirampok, ia merasa perlu semua jendela dan pintu terkunci beberapa kali sebelum mereka dapat meninggalkan rumah. Contoh lain saat seseorang mencuci tangan berulang kali karena takut kuman,” kata Dr Scarella.</p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\"><br></b></h3><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\"><br></b></h3><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">7. Gangguan Stres Pasca-Trauma</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\" style=\"box-sizing: border-box; display: block;\"><img alt=\"gangguan PTSD\" class=\"richtext-image full-width note-float-left\" height=\"533\" src=\"https://cdnt.orami.co.id/unsafe/468x312/cdn-cas.orami.co.id/parenting/images/475879-PGAAGA-463.width-800.jpg\" width=\"800\" style=\"box-sizing: border-box; border-style: none; vertical-align: middle; width: 468px; max-width: 100%; height: auto; float: left;\"><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Foto: Orami Photo Stock</i></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><i style=\"box-sizing: border-box;\">Post-traumatic stress disorder</i><span>&nbsp;</span>(<a href=\"https://www.orami.co.id/magazine/memahami-gejala-dan-penyebab-ptsd-pada-anak-di-bawah-6-tahun/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">PTSD</a>) adalah kondisi yang dapat berkembang setelah kejadian traumatis, seperti pelecehan seksual, kekerasan, kecelakaan, bencana alam, atau kematian seseorang yang dicintai.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Mengutip<span>&nbsp;</span><a href=\"https://www.psychiatry.org/patients-families/ptsd/what-is-ptsd#:~:text=Posttraumatic%20stress%20disorder%20(PTSD)%20is,sexual%20violence%20or%20serious%20injury.\" rel=\"nofollow\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\">American Psychiatric Association</a>, orang dengan PTSD memiliki pikiran atau perasaan yang intens dan mengganggu terkait dengan pengalaman mereka yang berlangsung lama setelah peristiwa traumatis berakhir.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Penderita PTSD mungkin menghidupkan kembali peristiwa itu melalui kilas balik atau mimpi buruk, mereka mungkin merasa sedih, takut atau marah, dan merasa terpisah atau terasing dari orang lain.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Biasanya, orang dengan PTSD juga akan menghindari situasi atau orang yang mengingatkan mereka pada peristiwa traumatis.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\">Selain itu, mereka mungkin memiliki reaksi negatif yang kuat terhadap sesuatu yang dianggap biasa oleh orang lain. Misalnya, suara keras atau sentuhan yang tidak disengaja.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</b><span>&nbsp;</span><a href=\"https://www.orami.co.id/magazine/cara-mengatasi-ptsd/\" style=\"box-sizing: border-box; color: rgb(255, 85, 85); text-decoration: none; background-color: transparent;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(255, 85, 85);\">6 Cara Mengatasi PTSD yang Paling Efektif</b></a></p></section></h2><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif;\"><b style=\"box-sizing: border-box; font-weight: bolder; color: rgb(0, 0, 0);\">8. Gangguan Kepribadian</b></h3><h2 class=\"ql-align-justify\" style=\"margin: 15px 0px; font-weight: inherit; line-height: 1.1; font-size: 16px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; color: rgb(51, 51, 51);\"><section class=\"block-paragraph\"><img alt=\"Ayo Hindari, Ini Dia 4 Penyebab Anak Kurang Percaya Diri 1.jpg\" class=\"richtext-image full-width note-float-left\" height=\"390\" src=\"https://cdnt.orami.co.id/unsafe/468x229/cdn-cas.orami.co.id/parenting/images/Ayo_Hindari_Ini_Dia_4_Penyebab_Anak_Kurang_Per.width-800.jpg\" width=\"800\" style=\"width: 468px; max-width: 100%; height: auto; float: left;\"><p><i>Foto: Orami Photo Stock</i></p><p>Gangguan kepribadian adalah masalah kesehatan mental yang memengaruhi sikap, kepercayaan, dan perilaku. Dua jenis gangguan kepribadian antara lain:</p><ul><li><span style=\"font-weight: bolder; color: rgb(0, 0, 0);\"><i>Borderline personality disorder</i></span><i>,</i>&nbsp;yaitu perubahan suasana hati yang intens, ketakutan akan ditinggalkan,&nbsp;<a href=\"https://www.orami.co.id/magazine/perilaku-impulsif/\" style=\"color: rgb(255, 85, 85);\">perilaku impulsif</a>, dan tidak stabil.</li><li><span style=\"font-weight: bolder; color: rgb(0, 0, 0);\"><i>Antisocial personality disorder</i></span><i>,</i>&nbsp;saat seseorang mengalami hal-hal seperti mengabaikan perasaan dan kebutuhan orang lain, memanipulasi orang lain untuk keuntungan diri sendiri, sulit mempertahankan hubungan, tidak merasa bersalah atas tindakan kurang menyenangkan yang dilakukan, serta merasa mudah bosan atau agresif.</li></ul><p><span style=\"font-weight: bolder; color: rgb(0, 0, 0);\">Baca Juga:</span>&nbsp;<a href=\"https://www.orami.co.id/magazine/6-manfaat-mendengarkan-musik-untuk-kesehatan-fisik-dan-mental/\" style=\"color: rgb(255, 85, 85);\"><span style=\"font-weight: bolder;\">6 Manfaat Mendengarkan Musik untuk Kesehatan Fisik dan Mental</span></a></p><p>Itulah jenis penyakit psikologi atau gangguan mental yang umum terjadi.</p><p>Perhatikan selalu kesehatan mental Moms, keluarga, dan orang-orang terdekat Moms, ya, karena kesehatan mental sama pentingnya dengan kesehatan fisik.</p></section><section class=\"block-paragraph custom-list accordion\"><input id=\"list-sumber-8768\" name=\"collapse\" type=\"checkbox\" style=\"position: absolute; left: -100vw;\"></section><br></h2><h3 class=\"list-title handle\" style=\"box-sizing: border-box; margin-top: 16px; margin-bottom: 0.5rem; font-weight: 500; line-height: 1.2; font-size: 16px; font-family: &quot;Modern Era Bold&quot;, sans-serif; position: relative; padding-left: 32px; color: rgb(255, 85, 85); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></h3></div>', 'Mengapa menjaga kesehatan mental penting untuk dilakukan?', 'http://grhasia.jogjaprov.go.id/assets/content_upload/images/imagefile__2020_12_15_09_54_47.jpg', 'Dwi', '2021-12-15 12:41:14', '2021-12-16 02:34:48');
