-- Records of solusii
-- ----------------------------
INSERT INTO `solusii` VALUES (1, '1', 'Kecemasan', 'Gangguan kesehatan mental yang ditandai dengan perasaan khawatir, cemas, atau takut yang cukup kuat untuk mengganggu aktivitas sehari-hari\r\nContoh gangguan kecemasan yaitu serangan panik, gangguan obsesif-kompulsif, dan gangguan stres pascatrauma.\r\nGejala berupa stres yang tidak sesuai dengan dampak peristiwa, ketidakmampuan untuk menepis kekhawatiran, dan gelisah.\r\nPerawatan termasuk konseling atau obat, termasuk antidepresan.', 'Hindari alkohol, Mengurangi asupan kafein, Olahraga rutin, Berhenti merokok, Meditasi atau relaksasi, Menyaring pikiran pelan - pelan, Diet yang sehat', 'Memahami mengapa beberapa orang mengalami gangguan kecemasan itu rumit, tetapi kita tahu bahwa orang-orang dari segala usia, jenis kelamin, dan lapisan masyarakat dapat terkena penyakit ini.\r\n\r\nSeringkali gangguan kecemasan dimulai sejak awal kehidupan, antara usia 10 dan 25 tahun – dengan onset rata-rata untuk sebagian besar gangguan kecemasan pada sekitar usia 21 tahun.\r\nWanita dua kali lebih mungkin dibandingkan pria untuk menderita gangguan kecemasan.\r\n\r\nGangguan kecemasan biasanya disertai dengan kondisi kesehatan mental lain seperti ketergantungan zat atau depresi - sebenarnya depresi campuran dan kecemasan adalah gangguan kesehatan mental yang paling umum.\r\n\r\nMentor profesional yang berkualifikasi dan berpengalaman adalah langkah pertama untuk mengetahui apa yang menyebabkan kecemasan Anda dan oleh karena itu konsultasi adalah langkah yang tepat untuk Anda.', 'Mudah merasa lelah.', 'Gelisah terus-menerus.', 'Kesulitan berkonsentrasi atau pikiran kosong.', 'Kesulitan mengendalikan perasaan khawatir.', 'Mengalami gangguan tidur, termasuk kesulitan atau selalu merasa kurang tidur.', '2021-12-21 04:44:35');
INSERT INTO `solusii` VALUES (2, '2', 'Depresi', 'Depresi adalah gangguan suasana hati (mood) yang ditandai dengan perasaan sedih yang mendalam dan rasa tidak peduli. Semua orang pasti pernah merasa sedih atau murung. Seseorang dinyatakan mengalami depresi jika sudah 2 minggu merasa sedih, putus harapan, atau tidak berharga.  Depresi yang dibiarkan berlanjut dan tidak mendapatkan penanganan bisa menyebabkan terjadinya penurunan produktifitas kerja, gangguan hubungan sosial , hingga munculnya keinginan untuk bunuh diri.', 'Menjadi produktif, Makan makanan yang sehat, Tidur yang cukup, Berani menghadapi masalah yang sedang dialami, Lakukan hal-hal yang baru dan menyenangkan dengan orang-orang terdekat.', 'Depresi lebih sering dialami oleh orang dewasa, dan penyebabnya diduga berhubungan dengan faktor genetik, hormon, dan zat kimia di otak. Beberapa faktor pemicu terjadinya depresi, di antaranya:  Mengalami peristiwa traumatis, Memiliki penyakit kronis atau serius, Mengonsumsi jenis obat tertentu, Memiliki riwayat gangguan mental lainnya, Memiliki tekanan batin, misalnya karena masalah keuangan atau masalah rumah tangga Memiliki pola pikir yang salah, misalnya toxic positivity.', 'Mengalami kecemasan dan kekhawatiran yang berlebihan', 'Tidak stabil secara emosional', 'Merasa putus asa atau frustrasi', 'Selalu merasa lelah dan tak bertenaga', 'Mengalami pusing dan rasa nyeri tanpa penyebab yang jelas dan Menurunnya selera makan', NULL);
INSERT INTO `solusii` VALUES (3, '3', 'Stress', 'Stres adalah reaksi tubuh yang muncul saat seseorang menghadapi ancaman, tekanan, atau suatu perubahan. Stres juga dapat terjadi karena situasi atau pikiran yang membuat seseorang merasa putus asa, gugup, marah, atau bersemangat.\n\nSituasi tersebut akan memicu respon tubuh, baik secara fisik ataupun mental. Respon tubuh terhadap stres dapat berupa napas dan detak jantung menjadi cepat, otot menjadi kaku, dan tekanan darah meningkat.', 'Berolahraga secara teratur, Menerapkan pola makan dengan gizi seimbang, Membatasi konsumsi kafein, Menghindari konsumsi alkohol dan NAPZA, Tidur yang cukup, Melakukan kegiatan yang menyenangkan hati, misalnya menonton acara di internet seperti video mukbang.', 'Stres sering kali dipicu oleh tekanan batin, seperti masalah dalam keluarga, hubungan sosial, patah hati, cinta tak berbalas, atau masalah keuangan. Selain itu, stres juga bisa dipicu oleh tekanan pekerjaan, pemutusan hubungan kerja (PHK), atau penyakit yang diderita.', 'Suasana hati yang mudah berubah', 'Tidak mau makan atau justru makan berlebihan,', 'Jantung berdebar', 'Gangguan pencernaan', 'Merasa kesepian', NULL);
INSERT INTO `solusii` VALUES (4, '4', 'Bipolar', 'Gangguan bipolar adalah gangguan mental yang ditandai dengan perubahan yang drastis pada suasana hati. Penderita gangguan ini bisa merasa sangat bahagia kemudian berubah menjadi sangat sedih.\r\n\r\nBerdasarkan data World Health Organization di tahun 2017, ada sekitar 45 juta orang di seluruh dunia yang menderita gangguan bipolar. Gangguan ini merupakan salah satu penyebab utama cacat dan kematian akibat bunuh diri di seluruh dunia.\r\n\r\nGangguan bipolar dapat diderita seumur hidup sehingga memengaruhi aktivitas penderitanya. Namun, pemberian obat-obatan dan psikoterapi dapat membantu penderita menjalani kegiatan sehari-hari.\r\n\r\n', 'Metode pengobatan yang dapat dilakukan berupa pemberian obat-obatan dan psikoterapi. Pengobatan gangguan bipolar ini bertujuan untuk mengurangi frekuensi munculnya gejala, membantu penderita kembali beraktivitas seperti biasanya, dan menurunkan risiko mengalami gangguan kesehatan lainnya.\r\n\r\nHingga saat ini, belum ada metode yang dapat mencegah gangguan bipolar. Namun, untuk mengurangi kambuhnya gejala, penderita dianjurkan untuk rutin mengonsumsi obat-obatan sesuai resep dokter atau menjalani psikoterapi.', 'Metode pengobatan yang dapat dilakukan berupa pemberian obat-obatan dan psikoterapi. Pengobatan gangguan bipolar ini bertujuan untuk mengurangi frekuensi munculnya gejala, membantu penderita kembali beraktivitas seperti biasanya, dan menurunkan risiko mengalami gangguan kesehatan lainnya.\r\n\r\nHingga saat ini, belum ada metode yang dapat mencegah gangguan bipolar. Namun, untuk mengurangi kambuhnya gejala, penderita dianjurkan untuk rutin mengonsumsi obat-obatan sesuai resep dokter atau menjalani psikoterapi.', 'Perasaan bahagia atau antusias', 'Semangat yang menggebu-gebu', 'Berkurangnya minat pada suatu kegiatan atau pekerjaan', 'Sulit tidur atau insomnia', 'Perasaan bersalah secara berlebihan', NULL);
INSERT INTO `solusii` VALUES (5, '5', 'PTSD', 'PTSD (post-traumatic stress disorder) atau gangguan stres pascatrauma adalah gangguan mental yang muncul setelah seseorang mengalami atau menyaksikan peristiwa yang tidak menyenangkan.\r\n\r\nPTSD merupakan gangguan kecemasan yang membuat penderitanya teringat pada kejadian traumatis. Peristiwa traumatis yang dapat memicu PTSD antara lain perang, kecelakaan, bencana alam, dan pelecehan seksual.\r\n\r\nMeski demikian, tidak semua orang yang teringat pada kejadian traumatis berarti terserang PTSD. Ada kriteria khusus yang digunakan untuk menentukan apakah seseorang mengalami PTSD.', 'Konsultasikan dengan psikiater bila muncul ingatan terhadap peristiwa traumatis yang mengganggu aktivitas, terutama bila berlangsung selama 1 bulan atau lebih.\r\n\r\nSegera konsultasi ke psikiater bila ingatan tentang kejadian traumatis sampai memicu Anda untuk menyakiti diri sendiri dan orang lain, atau sampai mendorong Anda untuk bunuh diri.', 'PTSD bisa muncul setelah seseorang mengalami atau menyaksikan peristiwa yang menakutkan atau mengancam nyawa. Belum diketahui secara pasti mengapa peristiwa tersebut menyebabkan PTSD bagi sebagian orang. Namun, ada dugaan bahwa penyebabnya adalah kombinasi dari sejumlah kondisi berikut: Pengalaman yang tidak menyenangkan, Riwayat gangguan mental pada keluarga, Kepribadian bawaan yang temperamen.', 'Pola pikir negatif', 'Cenderung untuk mencoba menghindari hal-hal yang menjadi pengingat trauma yang pernah mereka alami', 'Mimpi buruk hingga mengingat kembali kejadian yang pernah terjadi', 'Perubahan kepribadian dan isolasi sosial', 'Mudah marah, cemas, malu, hingga tidak adanya harapan mengenai masa depan.', NULL);
INSERT INTO `solusii` VALUES (6, '6', 'OCD', 'Pikiran berlebihan (obsesi) yang menyebabkan perilaku repetitif (kompulsi).\r\n\r\nGangguan obsesif-kompulsif ditandai dengan pikiran tak masuk akal dan ketakutan (obsesi) yang menyebabkan perilaku kompulsif.\r\nOCD sering berpusat pada suatu motif, misalnya takut kuman atau kewajiban mengatur benda-benda dalam pola tertentu. Gejala ini biasanya dimulai bertahap dan bervariasi sepanjang hidup.\r\nPerawatan termasuk terapi bicara, obat-obatan, atau keduanya.', 'Pengobatan terdiri dari perawatan diri dan terapi\r\nPerawatan termasuk terapi bicara, obat-obatan, atau keduanya.', 'Penyebab OCD belum diketahui secara pasti, namun terdapat sejumlah faktor yang dapat meningkatkan risiko seseorang mengalami OCD, yaitu: Menderita gangguan mental, Memiliki anggota keluarga yang menderita OCD, Pernah mengalami peristiwa tidak menyenangkan', 'Perilaku kompulsif, agitasi, gerakan berulang dan isolasi sosial.', 'Kewaspadaan berlebihan', 'Pengucapan kata yang tidak berarti', 'Penimbunan kompulsif dan perilaku impulsif', 'Perilaku ritualistik atau pengulangan kata atau tindakan secara terus-menerus', NULL);
INSERT INTO `solusii` VALUES (7, '7', 'ADHD', 'ADHD atau attention deficit hyperactivity disorder adalah gangguan mental yang menyebabkan seorang anak sulit memusatkan perhatian, serta memiliki perilaku impulsif dan hiperaktif, sehingga dapat berdampak pada prestasi anak di sekolah.\r\n\r\nKondisi kronis berupa kesulitan fokus, hiperaktif, dan impulsif.\r\nADHD sering dimulai pada masa kanak-kanak dan dapat bertahan sampai dewasa. Dapat menyebabkan rendah diri, hubungan bermasalah, dan kesulitan di sekolah atau dalam pekerjaan.\r\nGejala termasuk perhatian terbatas dan hiperaktif.\r\nPerawatan termasuk obat-obatan dan terapi bicara.', 'Penanganan ADHD dapat berupa pemberian obat-obatan dan psikoterapi. Selain penderita, orang tua, keluarga, pengasuh, dan guru di sekolah juga perlu mendapatkan bimbingan untuk menghadapi anak dengan ADHD. Walaupun ADHD tidak bisa disembuhkan sepenuhnya, pengobatan yang diberikan dapat meredakan gelaja ADHD dan memampukan penderitanya untuk menjalani hidup dengan normal.', 'Penyebab ADHD belum diketahui secara pasti. Namun, sejumlah penelitian menunjukkan bahwa ada beberapa faktor yang bisa meningkatkan risiko anak terkena ADHD. Faktor risiko ini meliputi faktor genetik dan lingkungan. ADHD juga diduga berkaitan dengan gangguan pada pola aliran listrik otak atau gelombang otak.', 'Bersemangat, bosan, kecemasan, marah atau perubahan suasana hati', 'Kesulitan dalam berfokus, kesulitan dalam memperhatikan, pikiran kosong, rentang perhatian yang pendek atau sering lupa', 'Depresi atau gangguan belajar', 'berperilaku agresif, gelisah, iritabilitas, perilaku hiperaktif, perilaku impulsif, terlalu bersemangat', 'Kehilangan pengendalian atau pengulangan kata atau tindakan secara terus-menerus', NULL);

