-- ----------------------------
-- View structure for view_hasil
-- ----------------------------
DROP VIEW IF EXISTS `view_hasil`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_hasil` AS SELECT
	id_tes, 
	total_nilai,
	CASE 
	WHEN total_nilai <= 20 THEN
		"Tidak Mengalami"
	WHEN total_nilai > 20 && total_nilai < 29 THEN
		"Kadang-kadang"
	WHEN total_nilai >= 30 THEN
		"Mengalamai"
	END AS hasil,
	id_kategori
FROM
	tes_hasil ;

-- ----------------------------
-- View structure for view_soal
-- ----------------------------
DROP VIEW IF EXISTS `view_soal`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_soal` AS SELECT
	soal.id, 
	soal.id_kategori, 
	categories.nama, 
	soal.opsi_a, 
	soal.opsi_b, 
	soal.opsi_c, 
	soal.opsi_d, 
	soal.opsi_e, 
	soal.created_at, 
	soal.updated_at
FROM
	categories
	INNER JOIN
	soal
	ON 
		categories.id_category = soal.id_kategori ;

-- ----------------------------
-- Triggers structure for table categories
-- ----------------------------
DROP TRIGGER IF EXISTS `Insert Category`;
delimiter ;;
CREATE TRIGGER `Insert Category` AFTER INSERT ON `categories` FOR EACH ROW BEGIN
	INSERT INTO solusi (id_kategori, solusi, hasil) VALUES(new.id_category, 'Baik-baik saja', '0-30');
	INSERT INTO solusi (id_kategori, solusi, hasil) VALUES(new.id_category, 'Sedang', '31-60');
	INSERT INTO solusi (id_kategori, solusi, hasil) VALUES(new.id_category, 'Menderita', '61-100');
	INSERT INTO solusii (id_kategori, kategori) VALUES(new.id_category, new.nama);
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table categories
-- ----------------------------
DROP TRIGGER IF EXISTS `Delete Category`;
delimiter ;;
CREATE TRIGGER `Delete Category` AFTER DELETE ON `categories` FOR EACH ROW BEGIN
	DELETE FROM solusi WHERE id_kategori=old.id_category;
	DELETE FROM solusii WHERE id_kategori=old.id_category;
	DELETE FROM soal WHERE id_kategori=old.id_category;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table tes_hasil
-- ----------------------------
DROP TRIGGER IF EXISTS `hasil`;
delimiter ;;
CREATE TRIGGER `hasil` AFTER INSERT ON `tes_hasil` FOR EACH ROW BEGIN
	UPDATE tes_hasil SET hasil = "Mengalami" WHERE id_kategori = NEW.id_kategori;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
